import { Form } from "react-router-dom";
import React, { useState , useEffect } from 'react'
import { useParams } from "react-router-dom";


export default function PersonalInfo() {

  const [Character, fetchCharacter] = useState({})
  let { id } = useParams();
  console.log("dllm " +id);

  const getData = () => {
  fetch("https://rickandmortyapi.com/api/character/"+id)
              .then((res) => res.json())
              .then((json) => {
                  console.log(json);
                  fetchCharacter(json)
              })
          }
  useEffect(() => {
     getData()
     }, [id])


  return (
    <>
      <div>
      <p>Contacts</p>
          <div>
            <form id="search-form" role="search">
              <input
                id="q"
                aria-label="Search contacts"
                placeholder="Search"
                type="search"
                name="q"
              />
              <div
                id="search-spinner"
                aria-hidden
                hidden={true}
              />
              <div
                className="sr-only"
                aria-live="polite"
              ></div>
            </form>
          </div>
        <p>{Character['name']}</p>
        <nav></nav>
      </div>
    </>
      )
      }
